import React from 'react';

function ChatOutput({ messages }) {
  return (
    <div className="chat-output mt-4">
      {messages.map((msg, index) => (
        <div key={index} className="chat-message">
          <strong>{msg.sender}:</strong> {msg.text}
        </div>
      ))}
    </div>
  );
}

export default ChatOutput;
